var tableTemplate = _.template(
    "<table>" + 
      "<thead>" + 
       "<tr><th>Rank</th><th>Name</th><th>Relative</th></tr>" + 
      "</thead>" + 
      "<% _.each(universities, function(u) { %>" +
        "<tr>" + 
          "<td> <%= u.rank %> </td>" + 
          "<td> <a href='<%=wikilink(u.title)%>'> <%= selected == u ? '<b>' + u.title + '</b>' : u.title %> </td> </a>" + 
          "<td> <%= new Number(u.relativeRank * 100).toPrecision(3) %>% </td>" + 
        "</tr>" + 
      "<% }); %>" +
    "</table>" 
);

function renderTable(universities, selectedUniversity) {
  $("#university-table-wrapper").html(tableTemplate({
    universities: universities,
    selected: selectedUniversity,
    wikilink: function(t) {
      return "http://en.wikipedia.org/wiki/" + t;
    }
  }));
}





$(document).ready(function() {
  var rankSum = _.reduce(UNIVERSITIES, function(memo, p) { return memo + p.rank; }, 0);

  var bestRank = UNIVERSITIES[0].rank;
  var universities = _.map(UNIVERSITIES, function(page, i) {
    return {
      title: page.title,
      rank: i+1,
      index: i,
      relativeRank: page.rank / bestRank,
      pagerank: page.rank / rankSum
    };
  });

  UNIVERSITIES = null;

  renderTable(_.first(universities, 10));
  histogramUniversities(universities);

  $("#university-typeahead").typeahead({
    name: "universities",
    local: _.map(universities, function(p, index) { return {value: p.title, index: index}; })
  }).on('typeahead:selected', function(e, university) {
    console.log(arguments);
    var start = Math.max(0, university.index - 5);
    var end = Math.min(start + 10, universities.length);
    renderTable(universities.slice(start, end), universities[university.index]);
  });

  function histogramUniversities(universities) {
    // Generate an Irwin.Hall distribution of 10 random variables.
    var values = d3.range(1000).map(d3.random.irwinHall(10));
    values = _.map(universities, function(v) { return Math.log(v.pagerank); });

    var margin = {top: 10, right: 30, bottom: 30, left: 30},
        width = 960 - margin.left - margin.right,
        height = 500 - margin.top - margin.bottom;

    var min = Math.min.apply(Math, values);
    var max = Math.max.apply(Math, values);

    var x = d3.scale.linear()
        .domain(d3.extent(values))
        .range([0, width]).nice();

    // Generate a histogram using twenty uniformly-spaced bins.
    var data = d3.layout.histogram()
        .bins(x.ticks(50))
        .frequency(false)
        .value(function(u) {
          return Math.log(u.pagerank);
        })(universities);

    var y = d3.scale.linear()
        .domain([0, d3.max(data, function(d) { return d.y; })])
        .range([height, 0]);

    var xAxis = d3.svg.axis()
        .scale(x)
        .orient("bottom");

    var yAxis = d3.svg.axis()
        .scale(y)
        .orient("left")
        .tickValues([0.02, 0.04, 0.06])
        .tickFormat(d3.format(",.0%"));


    var svg = d3.select("#university-histogram-svg")
        .attr("width", width + margin.left + margin.right)
        .attr("height", height + margin.top + margin.bottom)
      .append("g")
        .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

    
    var textWidth = 100;

    var rankText = svg.append("text")
      .attr("x", width + margin.left - textWidth)
      .attr("y", 10)
      .attr("width", textWidth)
      .attr("height", 100)
      .text("Ranks");
      

    var bar = svg.selectAll(".bar")
        .data(data)
      .enter().append("g")
        .attr("class", "bar")
        .attr("transform", function(d) { return "translate(" + x(d.x) + "," + y(d.y) + ")"; });

    function selectBar(elem) {
      selectedElement = elem;
      var data = elem[0][0].__data__;
      renderTable(universities.slice(data[0].index, data[0].index + 10));
      svg.selectAll("rect").attr("fill", "teal");
      elem.attr("fill", "black");
      rankText.text(data[0].rank + "-" + data[data.length -1].rank);
    }

    var selectedElement;
    var selectTimeout;

    bar.append("rect")
        .attr("x", 1)
        .attr("width", width / data.length - 1)
        .attr("fill", "teal")
        .style("cursor", "pointer")
        .attr("height", function(d) { return height - y(d.y); })
        .on("click", function(d) {
          selectBar(d3.select(this));
        })
        .on("mouseover", function(d) {
          var elem = d3.select(this);
          svg.selectAll("rect").attr("fill", "teal");
          elem.attr("fill", "blue");
          clearTimeout(selectTimeout);
          rankText.text(d[0].rank + "-" + d[d.length -1].rank);
        })
        .on("mouseout", function(D) {
          svg.selectAll("rect").attr("fill", "teal");
          if(selectedElement) {
            selectTimeout = setTimeout(function() {
              selectBar(selectedElement);
            }, 100);
          }
        });

    svg.append("g")
        .attr("class", "x axis")
        .attr("transform", "translate(0," + height + ")")
        .call(xAxis);

    svg.append("g")
        .attr("class", "yaxis")
        .call(yAxis);

    svg.selectAll("bar.rect").attr("fill", "black");

  }
});
